import './App.css';
import Home from './Screens/Home'
import {Route } from 'react-router-dom'
import Random from './Screens/Random'
function App() {
  return (
    <Route exact path='/' component={Home}/>,
    <Route exact path='/random' component={Random}/>

  );
}

export default App;
